  //清除页面中所有列表及碗中数据
  cleanPageList(){
    var that = this
    var gushuList = that.data.gushuList             //谷薯类列表
    var shuguoList = that.data.shuguoList           //蔬果类列表
    var dongwuList = that.data.dongwuList           //动物类列表
    var dadouList = that.data.dadouList             //大豆类列表
    var nengliangList = that.data.nengliangList     //能量类列表
    //清除各类标记
    that.setData({
      bowlList:[],
      bowlListFlag:0,
      totalCount:0
    })
    //清除谷薯类列表中的数量
    for(var i = 0 ;i < gushuList.nv_length;i ++){
      var gushuNumStr = 'gushuList[' + i + '].num'
      that.setData({
        [gushuNumStr]:0
      })
    }
    //清除蔬果类列表中的数量
    for(var i = 0 ;i < shuguoList.nv_length;i ++){
      var shuguoNumStr = 'shuguoList[' + i + '].num'
      that.setData({
        [shuguoNumStr]:0
      })
    }
    //清除动物类列表中的数量
    for(var i = 0 ;i < dongwuList.nv_length;i ++){
      var dongwuNumStr = 'dongwuList[' + i + '].num'
      that.setData({
        [dongwuNumStr]:0
      })
    }
    //清除大豆类列表中的数量
    for(var i = 0 ;i < dadouList.nv_length;i ++){
      var dadouNumStr = 'dadouList[' + i + '].num'
      that.setData({
        [dadouNumStr]:0
      })
    }
    //清除能量类列表中的数量
    for(var i = 0 ;i < nengliangList.nv_length;i ++){
      var nengliangNumStr = 'nengliangList[' + i + '].num'
      that.setData({
        [nengliangNumStr]:0
      })
    }
  },

//购物车bowlList与食物List分离方法未尝试成功，欢迎勇士继续修改，
//现在的版本是直接将所有的食物List置入，num为0则不显示

  judge(id){
    var that = this
    for(var i=0;i<that.data.bowlList.length;i++)
    {
      if(that.data.bowlList[i]._id == id)
      {
        return true 
      }
    }
    return false
  },
  // 获得索引值
  getBowlListIndex(id){
    var that = this
    for(var i=0;i<that.data.bowlList.length;i++)
    {
      if(that.data.bowlList[i]._id == id)
        return i; 
    }
    return -1;    
  },

  /**
   * 谷薯类
   * **/
  getGushuList(){
    var that = this
    db.collection("gushuList").get({}).then(res=>{
      console.log(res)
      that.setData({
        gushuList: res.data
      })
    })
  },
  gushuPlus(e){
    var that = this
    var index = e.currentTarget.dataset.index //这里的index是指模块的序列，非数组的下标
    var goodsId = e.currentTarget.dataset.goodsid //注意dataset里面的自定义值不能区分大小写
    var num = that.data.gushuList[index].num
    var bowlListFlag = that.data.bowlListFlag
    var bowlListItem = 'bowlList[' + bowlListFlag + ']'
    var gushuListNum = 'gushuList[' + index + '].num'
    var gushuListItem = that.data.gushuList[index]
    num++
    that.setData({  //注意写法
      [gushuListNum]: num,
      totalCount:that.data.totalCount+1,
    })

    // 第一次加入碗
    if(!that.judge(goodsId))
    {
      that.setData({
      [bowlListItem]: gushuListItem,
      bowlListFlag:that.data.bowlListFlag+1
      })
    }
    // 同类多次添加
    else
    {
      var bowlindex=this.getBowlListIndex(goodsId);
      var bowlListNum = 'bowlList[' + bowlindex + '].num';
      that.setData({
        [bowlListNum]: num,
      })
    }
  },
  gushuMinus(e){
    var that = this
    var index = e.currentTarget.dataset.index       //这里的index是指模块的序列，非数组的下标
    var goodsId = e.currentTarget.dataset.goodsid   //注意dataset里面的自定义值不能区分大小写

    var num = that.data.gushuList[index].num
    var bowlListFlag = that.data.bowlListFlag
    var gushuListNum = 'gushuList[' + index + '].num'
    var bowlListItem = 'bowlList[' + bowlListFlag + ']' 
    if(num == 0)
      return
    num--
    that.setData({
      [gushuListNum]: num,
      totalCount:that.data.totalCount-1
    })
    //全部取消了，移除该元素
    if(num==0){
      var bowlindex=that.getBowlListIndex(goodsId);
      that.data.bowlList.splice(bowlindex,1);
      var tempList=that.data.bowlList;
      that.setData({
        bowlList: tempList,
        bowlListFlag:that.data.bowlListFlag-1
      })
    }
    else{
      var bowlindex=this.getBowlListIndex(goodsId);
      var bowlListNum = 'bowlList[' + bowlindex + '].num';
      that.setData({
        [bowlListNum]: num,
      })
    }
  },


