  //获取当天日期
  getDate:function(){
    var that=this;
    var timestamp = Date.parse(new Date());
    var date = new Date(timestamp);
    var dateString = '';
    //获取年份  
    var Y =date.getFullYear();
    //获取月份  
    var M = (date.getMonth() + 1 < 10 ? '0' + (date.getMonth() + 1) : date.getMonth() + 1);
    //获取当日日期 
    var D = date.getDate() < 10 ? '0' + date.getDate() : date.getDate(); 
    //合并日期
    dateString = Y + M + D;
    that.setData({
      dateString:dateString
    })

    //判断当天是否登录过
    var singIn=0;
    for(var i = 0 ; i < that.data.signInDate_record.length;i ++){
      if(that.data.signInDate_record[i] == that.data.dateString){//当天登陆过
        singIn=1;
        console.log('当天登录过')
      }
    }
    
    if(!singIn||that.data.signInDate_record.length==0){//当天没有登录过
      console.log('当天没有登录过')
      that.setData({
        calorie_breakfast:0,
        calorie_lunch:0,
        calorie_dinner:0,
        calorie_lingshi:0,
        calorie_get:0
      })
      db.collection('user').doc(that.data._id)
      .update({
        data:{
          signInDate_record:that.data.signInDate_record.concat(dateString),
          calorie_breakfast:0,
          calorie_lunch:0,
          calorie_dinner:0,
          calorie_lingshi:0
        }
      })
    }

  },

