  /**
   * 生命周期函数--监听页面加载
   */
  onLoad: function (options) {
    var that = this
    that.getOpenid()              //获取用户的openid
    that.getsize()                //获取设备宽高
    //设置来适配全机型
    wx.getSystemInfo({
      success: function(res){
        console.log(res.windowHeight);
        //windows机型
        if(res.model.indexOf("Windows")!=-1){
          that.setData({
            bpgHgt: 700,
            scrollHgt: 650
          })
        }
        //ipad机型
        else if(res.model.indexOf("iPad")!=-1){
          that.setData({
            bpgHgt: 600,
            scrollHgt: 550
          })
        }
        //机型的高度小于iphone6plus 的高度，使用小的高度
        else if(res.windowHeight<=672){
          that.setData({
            bpgHgt: 800,
            scrollHgt: 750
          })
        }
        else{
          that.setData({
            bpgHgt: 1000,
            scrollHgt: 950
          })         
        }
      }
    })
    that.getGushuList();
    that.getShuguoList();         //获得蔬果类食物列表
    that.getDadouList();          //获得大豆类食物列表
    that.getDongwuList();
    that.getNengliangList();
    getApp().loadFont();
  },

